import AuthPage from "@/components/Auth.vue"
import AnaliticPage from "@/components/Analitic.vue"

const routes = [
          {
                    path: '/auth',
                    component: AuthPage
          },
          {
                    path: '/analitic',
                    component: AnaliticPage
          },
]
